  const [movies, setMovies] = useState([]);

  const removeMovie=(id)=>{
    setMovies(movies.filter(movie=>{
      return movie.id != id;
    }))
  }



  return (
    <Router>
      <div className="App">
        <Navbar/>
        <Switch>

          <Route path="/" exact> 
            <Home/>
          </Route>

          <Route path="/movies"> 

          </Route>

          <Route path="/users">
            <Users/>
          </Route>


        </Switch>
      </div>
    </Router>

  );
}

export default App;
